import React, {useState} from 'react';
import ImageGallery from 'react-image-gallery';
import styled, { keyframes } from 'styled-components'

const slide = keyframes`
    0% { 
        width: 10%;
        height: 10%;
    }
    100% {
        width: 10%;
        height: 10%;
    }
`

const Photo = styled.img`
    object-fit: cover;
    width: 10%;
    height: 10%;
    margin-right: 3px;
    transform: translateX(70%);
    transition: slide 10s ease-in-out 0s;
`

// width: 90%;
// height: 80%;
// margin: 7% 5% 10% 5%;

const PhotoReel = styled.div`
    display: flex;
    flex-direction: row;
    width: 90%;
    height: 80%;
    margin: 7% 5% 10% 5%;
    overflow: hidden;
`

const PhotoHolder = styled.div`
    display: flex;
    flex-direction: row;
    width: 100vw;
    height: 100vh;
`

const images = [
    {
        picture: require('../Images/1.jpg'),
    },
    {
        picture: require('../Images/2.jpg'),
    },
    {
        picture: require('../Images/3.jpg'),
    },
    {
        picture: require('../Images/4.jpg'),
    },
    {
        picture: require('../Images/5.jpg'),
    },
    {
        picture: require('../Images/6.jpg'),
    },
]

const nullImage = [{picture: ''}]

function Image() {

    const [picIndex, setPicIndex] = useState(0)

    return(
        <PhotoHolder>
            <PhotoReel>
                <Photo src = {images[0].picture}/>
            </PhotoReel>
        </PhotoHolder>
    );
}

export default Image
